actionConfiguration.body:
() =>{
		if (getStockOnHandForCarrier.data.data.getStockOnHand != null){

			let lines = getStockOnHandForCarrier.data.data.getStockOnHand
			let ret = []
			for(let i = 0; i < lines.length; i++){
				let materialCode = ""
				if (lines[i].material != null){
					materialCode = lines[i].material.code
				}
				let carrierCode = ""
				if(lines[i].carrier != null){
					carrierCode = lines[i].carrier.code
				}
				let statusCode = ""
				if(lines[i].status != null){
					statusCode = lines[i].status.code
				}
				let storageLocationName = ""
				if(lines[i].storageLocation != null){
					storageLocationName = lines[i].storageLocation.name
				}
				let quantity = lines[i].quantity
				let line = {
					"materialCode" : materialCode,
					"carrier": carrierCode,
					"status":statusCode,
					"storageLocation":storageLocationName,
					"quantity":quantity
				}

				ret.push(line)
			}
			return ret
		}else{
			return []
		}
	}

